import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import './UserDetails.scss';
import { getActionsFormate } from '../../utils/common';
import ACTIONS from '../../apiConfig/actions.constants';
import UserInfo from '../../components/UserInfo/UserInfo';
import { COMPONENTS } from '../../utils/constants';
import { FOOTPRINTS_COMPONENTS } from '../../config';
import pageConfig from '../../utils/pageConfig';


class UserDetails extends React.Component{
  constructor(props){
    super(props);
  }

  componentDidMount(){
    const {getUserDetials} = this.props;
    const { params } = this.props.match;
    const type = ACTIONS.USERS.GET_USER_INFO
    getUserDetials(type, {...params});
  }

  render(){
      const { page } = this.props;
      const { pageTitle, headerActions, components } = pageConfig[page];
      let key = 0;
      const Components =
        components &&
        components.map(comp => {
          const fpComp = FOOTPRINTS_COMPONENTS[comp];
          const fpCompData = this.props[comp];

          const Component = fpComp.component;
          const { actions } = fpComp;
          key += 1;
          return (
            <Component
              {...this.props}
              key={key}
              data={fpCompData}
              actions={actions}
            />
          );
        });
      return (
        <div className="user-details">
          <PageHeader title={pageTitle} actions={headerActions} />
          {Components}
          <div>Hello world</div>
        </div>
      );
    // return (
    //   <UserInfo {...this.props[COMPONENTS.USER]} />
    // );
  }
}

UserDetails.propTypes = {
  data: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired
};

const mapStateToProps = (state) =>({
  [COMPONENTS.USER]: state.userDetailsReducerStore[COMPONENTS.USER]
})

const mapDispatchToProps = dispatch => {
  return {
    getUserDetials: (type, data) => {
      dispatch(getActionsFormate(type, data));
    }
  };
}

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(UserDetails)
);
